import React, { useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import { Navigation, Autoplay } from 'swiper/modules';

const services = [
  { icon: '✈️', title: 'Airport Pickup' },
  { icon: '🏠', title: 'Housing Help' },
  { icon: '💼', title: 'Job Board' },
  { icon: '📚', title: 'Student Support' },
  { icon: '🆔', title: 'SIN & ID Setup' },
  { icon: '🛍️', title: 'Nepali Stores' },
  { icon: '📄', title: 'Legal Help' },
  { icon: '🗣️', title: 'Language Prep' },
  { icon: '🤝', title: 'Community' },
  { icon: '👨‍⚕️', title: 'Health Services' },
  { icon: '🧘‍♂️', title: 'Mental Wellness' },
  { icon: '📦', title: 'Courier & Cargo' },
  { icon: '🏦', title: 'Banking Advice' },
  { icon: '🍼', title: 'Childcare Info' },
  { icon: '🎓', title: 'Scholarship Guide' },
  { icon: '📅', title: 'Events Calendar' },
  { icon: '🧑‍🏫', title: 'Skill Training' },
  { icon: '📞', title: 'Emergency Contacts' },
  { icon: '🧾', title: 'Tax Filing Help' },
  { icon: '🎮', title: 'Youth Programs' },
  { icon: '🧑‍🍳', title: 'Cooking Classes' },
  { icon: '🛒', title: 'Grocery List' },
  { icon: '🚗', title: 'Driving License' },
  { icon: '📬', title: 'Postal & Shipping' },
  { icon: '🕌', title: 'Religious Centers' },
  { icon: '🏕️', title: 'Travel & Outdoors' },
  { icon: '🧼', title: 'Household Setup' },
  { icon: '💻', title: 'Digital Literacy' }
];

export default function Dashboard() {
  const navigate = useNavigate();
  const scrollRef = useRef(null);

  const scroll = (direction) => {
    if (scrollRef.current) {
      scrollRef.current.scrollBy({ left: direction === 'left' ? -300 : 300, behavior: 'smooth' });
    }
  };

  return (
    <div className="bg-gray-50 min-h-screen font-sans">
      {/* Top bar */}
      <div className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
        <h1 className="text-2xl font-bold text-blue-700">ConnectingNepali</h1>
        <button
          onClick={() => {
            localStorage.clear();
            navigate('/');
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      {/* Welcome Section */}
      <div className="bg-blue-100 text-center py-10 px-6">
        <h2 className="text-3xl font-bold text-gray-800 mb-2">Welcome, Nepali Immigrants!</h2>
        <p className="text-gray-700 text-lg">Explore essential services, support, and opportunities across Canada.</p>
      </div>

      {/* Promo Slider Section */}
      <div className="bg-emerald-900 text-white rounded-2xl my-10 mx-6 p-6 md:flex items-center justify-between shadow-lg overflow-hidden">
        <div className="flex-1 mr-6">
          <h2 className="text-3xl font-bold mb-2">Annoucements/Events</h2>
          <p className="mb-4 text-white/90">See the tick, know it's backed by Authenticity Guarantee.</p>
          <button className="bg-white text-emerald-900 px-5 py-2 rounded-full hover:bg-gray-100">Browse now</button>
        </div>

        <div className="flex-1 max-w-md">
          <Swiper
            spaceBetween={20}
            slidesPerView={1}
            autoplay={{ delay: 3000 }}
            navigation
            modules={[Navigation, Autoplay]}
            loop
          >
            {['shoe1.png', 'shoe2.png', 'shoe3.png'].map((img, index) => (
              <SwiperSlide key={index}>
                <div className="bg-white p-3 rounded-xl flex justify-center items-center h-48 shadow-md">
                  <img
                    src={`/images/${img}`}
                    alt={`Sneaker ${index + 1}`}
                    className="object-contain h-full w-auto"
                  />
                </div>
              </SwiperSlide>
            ))}
          </Swiper>
        </div>
      </div>

      {/* Our Services Section */}
      <div className="px-6 py-10 bg-white relative">
        <h2 className="text-2xl font-bold text-gray-800 mb-6">Our Services</h2>
        <button onClick={() => scroll('left')} className="absolute left-0 top-1/2 transform -translate-y-1/2 bg-white border rounded-full shadow px-2 py-1 z-10">◀</button>
        <div ref={scrollRef} className="flex space-x-4 overflow-x-auto no-scrollbar pb-4 px-6">
          {services.map((item, i) => (
            <div
              key={i}
              className="flex-shrink-0 w-36 bg-gray-50 rounded-xl shadow p-4 flex flex-col items-center justify-center text-center hover:shadow-md transition"
            >
              <div className="text-3xl mb-2">{item.icon}</div>
              <h4 className="text-sm font-semibold text-gray-700">{item.title}</h4>
            </div>
          ))}
        </div>
        <button onClick={() => scroll('right')} className="absolute right-0 top-1/2 transform -translate-y-1/2 bg-white border rounded-full shadow px-2 py-1 z-10">▶</button>
      </div>
    </div>
  );
}
